import React, { useEffect, useState } from "react";

const Deal = () =>{

    const [fırsatListe,setFırsatListe] = useState([])

    useEffect(() =>{
        const api_link="https://www.cheapshark.com/api/1.0/deals?storeID=1"
        fetch(api_link)
        .then(fl=>fl.json())
        .then(fl=>{
            setFırsatListe(fl)
        })
    })


    return(
        <div>
            {
                fırsatListe.map(fl=>
                    <div>
                        <h1>
                            {fl.title}
                        </h1>
                    </div>
                    )
            }
        </div>
    )
}

export default Deal;
